const Cart = () => {
  const {cartItem,food_list,removeToCart}=useContext(StoreContext);
  return (
    <div className='cart'>
      <div className="cart-items">
        <div className="cart-items-title">
        <th>
                <td>Items</td>
                <td>Title</td>
                <td>Price</td>
                <td>Quality</td>
                <td>Total</td>
                <td>Remove</td>
              </th>
              <Table/>
        </div>
        <br />
        <hr />
        {
            food_list.map((item,ind)=>{
             return (
              <p>{}</p>
             )
            })
        }
      </div>
    </div>
  )
}

export default Cart
